import React, { useEffect, useState } from "react";
import axios from "axios";
import { Row, Col, Container } from "react-bootstrap";

const Classes = () => {
  const [data, setData] = useState([]);
  const [classes, setClasses] = useState([]);

  const getData = async () => {
    await fetch("/drive/api")
      .then((res) => res.json())
      .then((res) => Object.assign({}, res.files[0]))
      .then((data) => {
        axios.post("/sheet/id", data);
      });

    await fetch("/sheet/api")
      .then((res) => res.json())
      .then((res) => setData(res.sheets.properties));
  };

  useEffect(() => {
    getData();
  }, []);

  if (data) {
    data.map((result) => {
      console.log(result.title);
    });
  }

  return (
    <>
      <Container className="classes text-center" fluid>
        <Row>
          <Col>
            <h3 style={{ color: "white", textAlign: "left" }}>Your Classes</h3>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Classes;
